import React from 'react';
import './App.css';

function App({ label, value, onChange }) {
  return (
    <div className="App">
     <div className="Calculator">
     <div className={`floating-label-input ${value ? "has-content" : ""}`}>
      <input
        type="text"
        value={value}
        onChange={onChange}
        required
      />
      <label>{label}</label>
    </div>
     </div>
    </div>
  );
}

export default App;
